selector_to_html = {"a[href=\"#signifikansniveau\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">24.1.3. </span>Signifikansniveau<a class=\"headerlink\" href=\"#signifikansniveau\" title=\"Permalink til denne overskrift\">#</a></h2><p>Signifikansniveauet ben\u00e6vnes <span class=\"math notranslate nohighlight\">\\(\\alpha\\)</span> og er den sandsynlighed, der anvendes til at skelne mellem at acceptere og forkaste nulhypotesen. Inden vi g\u00e5r i gang med et hypotesetest, skal vi bestemme os for et signifikansniveau. Det s\u00e6ttes normaltvist til <span class=\"math notranslate nohighlight\">\\(0{,}05\\)</span>, ogs\u00e5 skrevet som <span class=\"math notranslate nohighlight\">\\(5\\ \\%\\)</span>. Dette niveau kalder vi for et <span class=\"math notranslate nohighlight\">\\(5\\ \\%\\)</span>-signifikansniveau.</p><p>Foretages et hypotesetest, hvor nulhypotesen er sand, s\u00e5 betyder et signifikansniveau p\u00e5 <span class=\"math notranslate nohighlight\">\\(5\\ \\%\\)</span>, at hvis testen foretages 100 gange, s\u00e5 vil man komme til fejlagtigt at forkaste nulhypotesen fem gange i gennemsnit. S\u00e5, hvis man v\u00e6lger et lavere signifikansniveau, vil sandsynligheden for at man fejlagtigt forkaster en sand nulhypotese blive mindre. Det kan jo godt give anledning til, at man skal v\u00e6lge et lavt signifikansniveau, men det er midlertidigt ikke tilf\u00e6ldet. For jo lavere et signifikansniveau, man v\u00e6lger, jo sv\u00e6rere bliver det ogs\u00e5 at forkaste en falsk nulhypotese. Sagt med andre ord, et lavt signifikansniveau medf\u00f8rer ogs\u00e5, at der er en st\u00f8rre sandsynlighed for, at man acceptere en falsk nulhypotese. Man snakker derfor om to typer af fejl:</p>", "a[href=\"#opsummering-af-et-hypotesetest\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">24.1.6. </span>Opsummering af et hypotesetest<a class=\"headerlink\" href=\"#opsummering-af-et-hypotesetest\" title=\"Permalink til denne overskrift\">#</a></h2><p>4.a Bestem den kritiske m\u00e6ngde <span class=\"math notranslate nohighlight\">\\(K\\)</span>: Den kritiske m\u00e6ngde indeholder de ekstreme v\u00e6rdier for testst\u00f8rrelsen under nulhypotesen. Det er alts\u00e5 en samling af de v\u00e6rdier, som testst\u00f8rrelsen kun med ringe sandsynlighed vil antage, s\u00e5fremt nulhypotesen er sand.</p><p>4.b Bestem <span class=\"math notranslate nohighlight\">\\(p\\)</span>-v\u00e6rdien: <span class=\"math notranslate nohighlight\">\\(p\\)</span>-v\u00e6rdien angiver, hvor sandsynligt din observerede testst\u00f8rrelse er under nulhypotesen.</p>", "a[href=\"#nulhypotese\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">24.1.2. </span>Nulhypotese<a class=\"headerlink\" href=\"#nulhypotese\" title=\"Permalink til denne overskrift\">#</a></h2><p>Eftersom teorien bag hypotesetest er relativt abstrakt, vil vi starte med et eksempel.</p>", "a[href=\"../../Del_1/Deskriptiv_statistik/grundlaeggende-begreber-deskriptiv-statistik.html#grundlaeggendebegreber\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">12.1. </span>Grundl\u00e6ggende begreber<a class=\"headerlink\" href=\"#grundlaeggende-begreber\" title=\"Permalink til denne overskrift\">#</a></h1><p>N\u00e5r du arbejder med statistik, s\u00e5 er der en masse begreber, du skal have styr p\u00e5. De er vigtige for at kunne formidle, hvad det er for noget statistik, som man laver og arbejder med.</p>", "a[href=\"#hypotesetest_moent_fortsat\"]": "<div class=\"proof eksempel admonition\" id=\"hypotesetest_moent_fortsat\">\n<p class=\"admonition-title\"><span class=\"caption-number\">Eksempel 24.2 </span> (Sk\u00e6v m\u00f8nt (fortsat))</p>\n<section class=\"eksempel-content\" id=\"proof-content\">\n<p>Lad <span class=\"math notranslate nohighlight\">\\(X\\)</span> v\u00e6re en stokastisk variabel, der repr\u00e6senterer dit eksperiment. Hvis m\u00f8nten ikke er sk\u00e6v, s\u00e5 ved du, at sandsynligheden for at sl\u00e5 krone er <span class=\"math notranslate nohighlight\">\\(0{,}5\\)</span>, og at dit eksperiment vil v\u00e6re binomialt. Du kan derfor formulere din nulhypotese som:</p>\n<div class=\"math notranslate nohighlight\">\n\\[    H_0:\\ p = 0{,}5.\\]</div>\n<p>Den alternative hypotese vil v\u00e6re:</p>\n<div class=\"math notranslate nohighlight\">\n\\[    H_a:\\ p \\neq 0{,}5.\\]</div>\n<p>I dine 50 slag sl\u00e5r du krone 21 gange, men du ved, at under nulhypotesen vil <span class=\"math notranslate nohighlight\">\\(X\\sim\\text{Bin}(0{,}5;50)\\)</span>, da en ikke-sk\u00e6v m\u00f8nt har sandsynlighedsparameter <span class=\"math notranslate nohighlight\">\\(0{,}5\\)</span>. I eksperimentet svarer udfaldet krone til succes, <span class=\"math notranslate nohighlight\">\\(X=1\\)</span>. Baseret p\u00e5 dit eksperiment er sandsynligheden for succes:</p>\n<div class=\"math notranslate nohighlight\">\n\\[    \\frac{21}{50} = 0{,}42.\\]</div>\n<p>Sp\u00f8rgsm\u00e5let er nu, om 21 slag er for langt v\u00e6k fra 25 slag for at kunne sige, om m\u00f8nten er sk\u00e6v. Stikpr\u00f8ven best\u00e5r af 50 slag og den interessante testst\u00f8rrelse, <span class=\"math notranslate nohighlight\">\\(x_0\\)</span>, er antallet af kroner, ergo <span class=\"math notranslate nohighlight\">\\(x_0=21\\)</span>. For et signifikansniveau p\u00e5 <span class=\"math notranslate nohighlight\">\\(5\\ \\%\\)</span> kan den kritiske m\u00e6ngde bestemmes ved at l\u00f8se for de kritiske v\u00e6rdier <span class=\"math notranslate nohighlight\">\\(k_1\\)</span> og <span class=\"math notranslate nohighlight\">\\(k_2\\)</span> i ligningerne</p>\n<div class=\"math notranslate nohighlight\">\n\\[    \\mathbb{P}(X \\leq k_1) \\leq \\frac{0{,}05}{2}\\quad \\text{og}\\quad \\mathbb{P}(X \\geq k_2) \\leq \\frac{0{,}05}{2}. \\]</div>\n<p>Ved brug af et CAS-v\u00e6rkt\u00f8j f\u00e5s <span class=\"math notranslate nohighlight\">\\(k_1 = 17\\)</span> og <span class=\"math notranslate nohighlight\">\\(k_2 = 33\\)</span> og den kritiske m\u00e6ngder</p>\n<div class=\"math notranslate nohighlight\">\n\\[    K = \\{ X\\leq 17 \\}\\cup\\{ X\\geq 33 \\} = \\{0,1,\\dots,17,33,34,\\dots,50\\}.\\]</div>\n<p>Eftersom testst\u00f8rrelsen <span class=\"math notranslate nohighlight\">\\(x_0=21\\)</span> ikke er i den kritiske m\u00e6ngde, accepterer du nulhypotesen og konkluderer, at m\u00f8nten ikke er sk\u00e6v.</p>\n</section>\n</div>", "a[href=\"#p-vaerdi\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">24.1.5. </span><span class=\"math notranslate nohighlight\">\\(p\\)</span>-v\u00e6rdi<a class=\"headerlink\" href=\"#p-vaerdi\" title=\"Permalink til denne overskrift\">#</a></h2><p>Et sidste vigtigt begreb for statistiske test er den s\u00e5kaldte <span class=\"math notranslate nohighlight\">\\(p\\)</span>-v\u00e6rdi. Vi kan ogs\u00e5 afg\u00f8re om nulhypotesen skal forkastes p\u00e5 baggrund af denne st\u00f8rrelse.</p><p><span class=\"math notranslate nohighlight\">\\(p\\)</span>-v\u00e6rdien er et m\u00e5l for, hvor sandsynligt det er at observere en ny stikpr\u00f8ve med en testst\u00f8rrelse <span class=\"math notranslate nohighlight\">\\(x_1\\)</span>, der er mindst lige s\u00e5 ekstrem som den observerede testst\u00f8rrelse <span class=\"math notranslate nohighlight\">\\(x_0\\)</span>, givet nulhypotesen er sand. Den bruges i hypotesetestning til at bestemme, om resultaterne af et eksperiment er <em>statistiske signifikante</em>. N\u00e5r et resultat er statistisk signifikant, betyder det, at resultatet er trov\u00e6rdigt og ikke skyldes held eller tilf\u00e6ldigheder. En lav <span class=\"math notranslate nohighlight\">\\(p\\)</span>-v\u00e6rdi indikerer, at resultaterne fra det statistiske test er us\u00e6dvanlige under nulhypotesen, hvorfor den i det tilf\u00e6lde oftest forkastes. Jo mindre <span class=\"math notranslate nohighlight\">\\(p\\)</span>-v\u00e6rdi, jo mindre trov\u00e6rdig testst\u00f8rrelse og nulhypotese.</p>", "a[href=\"#kritisk-maengde\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">24.1.4. </span>Kritisk m\u00e6ngde<a class=\"headerlink\" href=\"#kritisk-maengde\" title=\"Permalink til denne overskrift\">#</a></h2><p>Den kritiske m\u00e6ngde kan bestemmes, n\u00e5r man ved hvilket test, man \u00f8nsker at lave, samt har valgt et signifikansniveau. Den kritiske m\u00e6ngde er m\u00e6ngden af udfald, der er de mindst sandsynlige og kan bruges til at bestemme hvorledes nulhypotesen skal forkastes eller ej. Vi ben\u00e6vner den kritiske m\u00e6ngde med <span class=\"math notranslate nohighlight\">\\(K\\)</span>.</p><p>Det modsatte af den kritiske m\u00e6ngde er acceptm\u00e6ngden, der ben\u00e6vnes <span class=\"math notranslate nohighlight\">\\(A\\)</span>. Det er alts\u00e5 m\u00e6ngden af udfald, der er de mest sandsynlige. Disse ligger oftest omkring middelv\u00e6rdien.</p>", "a[href=\"#stikprover-og-hypotesetest\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">24.1. </span>Stikpr\u00f8ver og hypotesetest<a class=\"headerlink\" href=\"#stikprover-og-hypotesetest\" title=\"Permalink til denne overskrift\">#</a></h1><h2><span class=\"section-number\">24.1.1. </span>Stikpr\u00f8ve<a class=\"headerlink\" href=\"#stikprove\" title=\"Permalink til denne overskrift\">#</a></h2><p>Du st\u00f8dte ogs\u00e5 p\u00e5 begrebet \u00bbstikpr\u00f8ve\u00ab tilbage i <a class=\"reference internal\" href=\"../../Del_1/Deskriptiv_statistik/grundlaeggende-begreber-deskriptiv-statistik.html#grundlaeggendebegreber\"><span class=\"std std-ref\">Grundl\u00e6ggende begreber</span></a>, men vi vil i dette afsnit grave lidt dybere for at udvide vores forst\u00e5else af dette begreb.</p><p>I en verden, hvor data er overalt, er det essentielt at forst\u00e5, hvordan vi indsamler og analyserer disse informationer. Statistikken giver os v\u00e6rkt\u00f8j til at g\u00f8re netop dette. I Danmark indsamler Danmarks Statistik omfattende data om befolkningen, alt fra f\u00f8dselstal til \u00f8konomiske n\u00f8gletal, hvilket giver en unik indsigt i samfundets tilstand og udvikling.</p>", "a[href=\"#stikprove\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">24.1.1. </span>Stikpr\u00f8ve<a class=\"headerlink\" href=\"#stikprove\" title=\"Permalink til denne overskrift\">#</a></h2><p>Du st\u00f8dte ogs\u00e5 p\u00e5 begrebet \u00bbstikpr\u00f8ve\u00ab tilbage i <a class=\"reference internal\" href=\"../../Del_1/Deskriptiv_statistik/grundlaeggende-begreber-deskriptiv-statistik.html#grundlaeggendebegreber\"><span class=\"std std-ref\">Grundl\u00e6ggende begreber</span></a>, men vi vil i dette afsnit grave lidt dybere for at udvide vores forst\u00e5else af dette begreb.</p><p>I en verden, hvor data er overalt, er det essentielt at forst\u00e5, hvordan vi indsamler og analyserer disse informationer. Statistikken giver os v\u00e6rkt\u00f8j til at g\u00f8re netop dette. I Danmark indsamler Danmarks Statistik omfattende data om befolkningen, alt fra f\u00f8dselstal til \u00f8konomiske n\u00f8gletal, hvilket giver en unik indsigt i samfundets tilstand og udvikling.</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,
                onShow(instance) {MathJax.typesetPromise([instance.popper]).then(() => {});},
            });
        };
    };
    console.log("tippy tips loaded!");
};
